import styled from "styled-components";
import Home from "../Img/akar-icons_home-alt1.svg";
const Container = styled.div`
  width: 100px;
  height: 100px;
  border: 1px solid black;
`;

export default function Nav() {
  return (
    <Container>
      <img src={Home}></img>
    </Container>
  );
}
